import axios from 'axios';

const baseUrl = 'http://localhost'

export const getMessage = () => {
    return axios.get('${baseUrl}/testingApi')
        .then(response => response.data)
        .catch(error => {
            console.error('Error fetching data:', error);
            throw error;
        })
}
